INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100101, "人助けが大好き！　前向き格闘娘", "獣人族", "人助け、応援", "A", "トゥインクルウィッシュ", 155, 16, 44, 27, 8, 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ", "東山奈央", 0);
