INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100701, "プリン大好きゴースト娘", "魔族", "プリンを食べること", "B", "悪魔偽王国軍（ディアボロス）", 130, 14, 32, 23, 1, 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ", "雨宮天", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (100801, "ボクは誰よりも美しい", "エルフ", "鏡で自分を見ること", "AB", "ヴァイスフリューゲル　ランドソル支部", 150, 14, 40, 10, 10, 15, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ", "大空直美", 0);
