INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (102101, "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", "観劇、おままごと", "B", "サレンディア救護院", 150, 12, 40, 9, 6, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ", "植田佳奈", 0);
