INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (105001, "ちょっとおませな恋に恋する女の子", "魔族", "ファッション誌鑑賞、コスメ集め", "A", "ルーセント学院", 120, 11, 22, 3, 1, 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ", "久野美咲", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (105101, "実験が趣味の危険な科学者", "ヒューマン", "研究、実験", "A", "トワイライトキャラバン", 166, 27, 53, 7, 3, 13, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ミツキ", "三石琴乃", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (105201, "乙女チックなもふもふアニマル", "獣人族", "毛繕い、お喋り", "A", "牧場（エリザベスパーク）", 150, 18, 100, 14, 3, 11, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "リマ", "徳井青空", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (105301, "見た目も中身もお子ちゃまな異国の軍人", "ヒューマン", "お菓子屋通い", "A", "ヴァイスフリューゲル　ランドソル支部", 140, 18, 33, 28, 7, 15, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "モニカ", "辻あゆみ", 0);
