INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (105701, "空への冒険を夢見る騎空士の少女", "ヒューマン", "冒険、おしゃべり", "O", "？？？", 156, 17, 45, 10, 3, "", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "ジータ", "金元寿子", 0);
