INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (107901, "弱きを助け強きをくじく猫娘", "獣人族", "猫とたわむれること", "AB", "メルクリウス財団", 158, 18, 48, 1, 3, 12, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ（サマー）", "沼倉愛美", 0);
