INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108101, "占いが得意な霊能少女", "魔族", "占い", "AB", "悪魔偽王国軍（ディアボロス）", 157, 18, 42, 22, 12, 7, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ（ハロウィン）", "大坪由佳", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108201, "プリン大好きゴースト娘", "魔族", "プリンを食べること", "B", "悪魔偽王国軍（ディアボロス）", 130, 14, 32, 23, 1, 7, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ（ハロウィン）", "雨宮天", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108301, "ちょっとおませな恋に恋する女の子", "魔族", "ファッション誌鑑賞、コスメ集め", "A", "ルーセント学院", 120, 11, 22, 3, 1, 14, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ（ハロウィン）", "久野美咲", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108401, "人々を守るために歌う、唱喚士の少女", "ヒューマン", "各種楽器", "O", "カルミナ", 163, 17, 46, 3, 6, 4, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（クリスマス）", "福原綾香", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108501, "泣き虫で臆病な守ってあげたい女の子", "ヒューマン", "観劇、おままごと", "B", "サレンディア救護院", 150, 12, 40, 9, 6, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ（クリスマス）", "植田佳奈", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108601, "ぷうきちといつも一緒！", "ヒューマン", "屋内でできる遊び", "B", "サレンディア救護院", 148, 14, 38, 10, 5, 9, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ（クリスマス）", "芹澤優", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108701, "人助けが大好き！　前向き格闘娘", "獣人族", "人助け、応援", "A", "トゥインクルウィッシュ", 155, 16, 44, 27, 8, 2, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（ニューイヤー）", "東山奈央", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108801, "戦闘のサポートが得意な、心優しい少女", "ヒューマン", "料理、人間観察", "O", "トゥインクルウィッシュ", 158, 17, 47, 5, 4, 2, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（ニューイヤー）", "種田梨沙", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (108901, "クールで何事にも真っ直ぐな剣士", "魔族", "読書、乗馬、お茶", "B", "トゥインクルウィッシュ", 163, 18, 46, 12, 1, 2, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（ニューイヤー）", "早見沙織", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109001, "運命の相手に一途すぎる乙女", "魔族", "実験、裁縫、料理", "B", "トワイライトキャラバン", 154, 16, 43, 30, 7, 13, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（バレンタイン）", "橋本ちなみ", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109101, "お姉ちゃんがお世話してあげるからねっ！", "ヒューマン", "家事全般", "O", "ラビリンス", 168, 18, 54, 24, 10, 3, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル（バレンタイン）", "生天目仁美", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109201, "英霊と契約を結んだマナリアの天才王女", "ヒューマン", "読書", "AB", "？？？", 156, 17, 55, 1, 12, "", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "アン", "日笠陽子", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109301, "マナリア魔法学院の新入生", "ヒューマン", "食べること、眠ること", "O", "？？？", 144, 15, 45, 4, 2, "", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ルゥ", "こやまきみこ", 0);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES (109401, "人を超越した力を有す心優しい竜姫", "半人半竜", "ピアノ", "B", "？？？", 167, 17, 67, 3, 11, "", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "グレア", "福原綾香", 0);
